let defaultFont = 'Arial';
let defaultFamily = '';
let defaultWeight = 'normal';
let defaultSize = 16;

/**
 * Function to update the fonts available to the site
 * @param key Key of the new font
 * @param props Define the new font metrics
 */
export function updateFonts(key: string, props: FontOptions) {
	fontDefinitions[key] = props;
}

export function getFonts(): Record<string, string> {
	return fontDefinitions;
}

export function getFont(key: string): FontOptions {
	try {
		return fontDefinitions[key];
	} catch(e) {
		console.error(e.message);
		throw new Error('Font ' + key + ' not registered. You should add the font first.');
	}
}

export function getFontFamily(): string {
	return (defaultFamily||"").replace(/\"/g,"'");
}

export function getFontWeight(): string {
	return defaultWeight;
}

export function getFontSize(): string {
	return defaultSize;
}

export function setDefaultFonts({
	family, weight, fonts, size
}: {
	family?: string;
	weight?: string;
	size?: number;
	fonts?: Record<string, FontOptions>;
}){

	// If fonts are provided when instantiating the plugin, map these into the defaults.
	if(fonts){
		for(const [key, props] of Object.entries(fonts) ) {
			updateFonts(key, props);
		}
	}

	// If we've provided a family we set the default
	if(typeof family==="string" && family!==""){
		defaultFamily = family;
		let f = getFontMatch(family)
		if(f.font){
			defaultFont = f.font;
			if(f.i > 0){
				console.warn('The metrics of your first font choice - "'+f.fonts[0]+'" - are not registered.');
				console.warn('Using the metrics for "'+f.font+'" instead. This may result in badly positioned chart labels.');
			}
		}else{
			console.error('Failed to set font→family to "'+family+'". Known fonts include:\n  - '+Object.keys(fontDefinitions).join("\n  - "));
			console.error('You should register "'+family+'" in your site\'s _config.[js|ts].');
			console.error('See https://open-innovations.github.io/oi-lume-charts/documentation/fonts/#customise-fonts for more details.');
			throw 'No known font found in font-family "'+family+'".';
		}
	}

	// If we've provided a weight we set the default
	if(weight && (weight=="bold" || weight=="normal")){
		defaultWeight = weight;
		if(typeof fontDefinitions[defaultFont][defaultWeight]===undefined){
			throw 'No weight "'+defaultWeight+'" set for '+defaultFont+'.';
		}
	}
	
	if(size){
		defaultSize = size;
	}
}

function getFontMatch(font){
	const fontparts = font.split(/,(?=(?:[^\"]*\"[^\"]*\")*(?![^\"]*\"))/g);
	let match = "";
	for(let f = 0; f < fontparts.length; f++){
		fontparts[f] = fontparts[f].replace(/^\"|\"$/g,"").trim();
	}
	for(let f = 0; f < fontparts.length; f++){
		if(fontDefinitions[fontparts[f]]){
			return {'i':f,'font':fontparts[f],'fonts':fontparts};
		}
	}
	return {'i':-1,'font':'','fonts':fontparts};
}

function knownFont(font){
	let match = getFontMatch(font);
	return match.font;
}

/*
	Function to estimate pixel length of text strings
	Currently only works for limited typefaces in standard/bold
*/
export function textLength(txt,fs,weight,font){

	if(typeof font!=="string" || font==""){
		console.warn('No font specified so defaulting to '+defaultFont+'.');
		font = defaultFont;
	}
	if(!weight) weight = defaultWeight;

	let match = knownFont(font);

	if(!match){
		console.warn('We do not know the widths of glyphs for the font "'+font+'" so we are defaulting to '+defaultFont+'.');
		match = defaultFont;
	}
	if(!fontDefinitions[match][weight]){
		console.warn('We do not know the widths for the weight "'+weight+'" so we are defaulting to '+defaultWeight+'.');
		weight = defaultWeight;
	}

	if(typeof fontDefinitions[match][weight]==="function") return fontDefinitions[match][weight](txt,fs);

	var len = 0;
	var c,code,widths,f;
	f = fontDefinitions[match][weight]||fontDefinitions[match][defaultWeight]; 

	for(c = 0; c < txt.length; c++){
		code = txt.charCodeAt(c);
		len += (fs/f["font-size"])*(code < f.widths.length ? f.widths[code] : 1);
	}
	return len;
}